import {
    GET_DATA,
    GET_DATA_SUCCESS,
    GET_DATA_ERROR,
    GET_DATA_IMAGE,
    GET_DATA_IMAGE_ERROR,
  } from "./actionTypes"

  export const getData = () => ({
    type: GET_DATA,
  })
  
  export const getDataSuccess = resp => ({
    type: GET_DATA_SUCCESS,
    payload: resp,
  })
  
  export const getDataFail = error => ({
    type: GET_DATA_ERROR,
    payload: error,
  })

  export const getDataImage = (req) => ({
    type: GET_DATA_IMAGE,
    payload: { req },
  })

  export const getDataImageFail = error => ({
    type: GET_DATA_IMAGE_ERROR,
    payload: error,
  })
